import "./App.css";
import Home from "./components/Home";
import Nav from "./components/Nav";
import Quiz from "./components/Quiz";
import { useState , useEffect } from "react";

function App() {
  const [questionNumber, setQuestionNumber] = useState(1);
  const questions = [
    {
      id: 1,
      question: "Last movie i watched ? ",
      answers: [
        {
          text: "Thor",
          correct: false,
        },
        {
          text: "Minions",
          correct: false,
        },
        {
          text: "Kotaro Lives Alone",
          correct: true,
        },
        {
          text: "Nice View",
          correct: false,
        },
      ],
    },
    {
      id: 2,
      question: "How many siblings i have ?",
      answers: [
        {
          text: "0",
          correct: false,
        },
        {
          text: "1",
          correct: true,
        },
        {
          text: "2",
          correct: false,
        },
        {
          text: "3",
          correct: false,
        },
      ],
    },
    {
      id: 3,
      question: "Do I have any pets? if so, what kind ? ",
      answers: [
        {
          text: "Dog",
          correct: false,
        },
        {
          text: "Car",
          correct: false,
        },
        {
          text: "Goat",
          correct: false,
        },
        {
          text: "None",
          correct: true,
        },
      ],
    },
    {
      id: 4,
      question: "What is my MBTI personality type? ",
      answers: [
        {
          text: "ISTJ",
          correct: true,
        },
        {
          text: "INFJ",
          correct: false,
        },
        {
          text: "ENTJ",
          correct: false,
        },
        {
          text: "ESTJ",
          correct: true,
        },
      ],
    },
  ];

  return (
    <>
      <Nav/>
      {/* <Home/> */}
      <Quiz questions={questions} questionNumber={questionNumber} setQuestionNumber={setQuestionNumber}/>


    </>
  );
}

export default App;
